				case 0x1d: return Mov_w(at(r0,r1),r0);
				case 0x1e: return Mov_l(at(r0,r1),r0);
				case 0x1f: return Mac_l(at(p(r1)),at(p(r0)));
				case 0x20: return Word(0x0020);
				case 0x21: return Word(0x0021);
